import React from "react";
import * as S from "./styled";
import { Link } from "react-router-dom";
import Input from "components/Form/InputField";
import InputPassWord from "components/Form/PasswordField";
import { Heading2 } from "components/common/Text";
import Button from "components/Button";

import { ReactComponent as IconFb } from "images/logo-facebook.svg";
import IconGg from "images/logo-google.svg";
const Login = () => {
  return (
    <>
      <div className="row">
        <div className="col-md-4"></div>
        <div className="col-md-8">
          <S.Wrapper>
            <div className="row">
              <div className="col-md-9">
                <Heading2 padding="20px 0px 20px 0px" margin="10px 0px">
                  Đăng Nhập{" "}
                </Heading2>
                <div className="row">
                  <div className="col-md-6">
                    <Button icon={ <IconFb />}>hihifb</Button>
                   
                  </div>
                  <div className="col-md-6">
                    <Button icon={IconGg}>hihigg</Button>
                  </div>
                </div>

                <form id="form-submit">
                  <div className="form-group pt-3">
                    <Input type="email" placeholder="Email Address" />
                  </div>
                  <div className="form-group pt-3">
                    <InputPassWord type="password" placeholder="Password" />
                  </div>
                  <div className="form-group pt-5 ">
                    <Button>Sign In</Button>
                  </div>
                </form>
                <div className="form-group pt-3">
                  <span className="account-text ">Bạn chưa có tài khoản ?</span>
                  <Link to="/register">Đăng kí </Link>
                </div>
              </div>
            </div>
          </S.Wrapper>
        </div>
      </div>
    </>
  );
};
export default Login;
